import classes from './BookRooms.module.css'
function BookRooms(){
    return(
        <div className={classes.bookingSection}>
           <label className={classes.bookingLabels} htmlFor='fromDate'>From</label>
           <input className={classes.inputFields} type='date'></input>
           <label className={classes.bookingLabels} htmlFor='toDate'>To</label>
           <input className={classes.inputFields} type='date'></input>

        </div>
    )
}
export  default BookRooms
